-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `username` varchar(50) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(255) NOT NULL DEFAULT '' COMMENT '密码',
  `nickname` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称',
  `avatar` varchar(255) NOT NULL DEFAULT '' COMMENT '头像',
  `membertype` tinyint(1) NOT NULL DEFAULT '0' COMMENT '会员类型',
  `ylmguid` int(10) NOT NULL DEFAULT '0' COMMENT '云联美购商城UID',
  `mobile` varchar(100) NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(100) NOT NULL DEFAULT '' COMMENT '邮箱',
  `realname` varchar(100) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `idnumber` varchar(100) NOT NULL DEFAULT '' COMMENT '身份证号码',
  `lastlogin_time` int(10) NOT NULL DEFAULT '0' COMMENT '最后登陆时间',
  `lastlogin_ip` varchar(50) NOT NULL DEFAULT '' COMMENT '最后登陆IP',
  `usertoken` varchar(100) NOT NULL DEFAULT '' COMMENT '登陆令牌，API请求中替代UID',
  `stockpoint` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '库存积分',
  `redpoint` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '红积分',
  `whitepoint` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '白积分',
  `balance` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '用户状态',
  `recommenderid` int(10) NOT NULL DEFAULT '0' COMMENT '推荐人ID',
  `recommenders` text NOT NULL COMMENT '多级推荐人',
  `auth_key` varchar(100) NOT NULL DEFAULT '',
  `modified` int(10) NOT NULL DEFAULT '0' COMMENT '编辑时间',
  `created` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `lastbalance_date` int(8) NOT NULL DEFAULT '0' COMMENT '最后结算日期',
  `editinitpwd` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否修改过初始密码',
  `province` varchar(100) DEFAULT '' COMMENT '省',
  `city` varchar(100) DEFAULT '' COMMENT '市',
  `country` varchar(100) DEFAULT '' COMMENT '县',
  `level` tinyint(2) DEFAULT '1' COMMENT '代理商等级 1：区域代理 2：区域二级代理',
  `is_activated` tinyint(2) DEFAULT '2' COMMENT '是否激活 1：激活 2：未激活',
  `activated_time` int(10) DEFAULT '0' COMMENT '激活时间',
  `upline_id` int(11) DEFAULT '0' COMMENT '上线id 0：云联美购',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=3427 DEFAULT CHARSET=utf8 COMMENT='用户表';

